import Head from "next/head";
import SideBarNav from './SideBarNav';
import TitleBar from './TitleBar';

const Layout = props => (
  <div>
    <SideBarNav {...props} />
    <TitleBar {...props} />
    {props.children}
  </div>
);

export default Layout;
